import React, { useState } from "react";
import { Link, useHistory } from "react-router-dom";
import Header from "./../components/Header";
import axios from 'axios';

const Register = () => {
  const [fullname, setFullName] = useState('');
  const [mobilenumber, setMobileNumber] = useState('');
  const [email, setEmail] = useState('');
  const history = useHistory();

  const handleRegister = async (e) => {
    e.preventDefault();
    let requestId = '';
    const data = new FormData();
    data.append('name', fullname);
    data.append('mobilenumber', mobilenumber);
    data.append('email', email);
    data.append('requestId', requestId);

    try {
      let response = await axios.post('https://localhost:3001/api/user/register', data, {
        header: {
          'Content-Type': 'application/json',
        }
      });
      if (response.data) history.push('/login');
    } catch (e) {
      return e.messages
    }
  }

  return (
    <>
      {/* <Header />
      <div className="container d-flex flex-column justify-content-center align-items-center login-center">
        <form onSubmit={handleRegister} className="Login col-md-8 col-lg-4 col-11">
          <input type="text" placeholder="Fullname" value={fullname} onChange={(e) => setFullName(e.target.value)} required />
          <input type="text" placeholder="Mobile" value={mobilenumber} onChange={(e) => setMobileNumber(e.target.value)} required />
          <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} required />

          <button type="submit">Register</button>
          <p>
            <Link to={"/login"}>
              I Have Account <strong>Login</strong>
            </Link>
          </p>
        </form>
      </div> */}
      <div class="bg-white dark:bg-gray-900">
        <div class="flex justify-center h-screen">
          <div class="hidden bg-cover lg:block lg:w-2/3" style={{ backgroundImage: `url(https://cdn.vectorstock.com/i/1000x1000/05/86/fish-shop-isometric-vector-31470586.webp)` }}>
            <div class="flex items-center h-full px-20 bg-gray-900 bg-opacity-40">
              <div>
                <h2 class="text-4xl font-bold text-white">Seafreshing</h2>

                <p class="max-w-xl mt-3 text-gray-300">Lorem ipsum dolor sit, amet consectetur adipisicing elit. In autem ipsa, nulla laboriosam dolores, repellendus perferendis libero suscipit nam temporibus molestiae</p>
              </div>
            </div>
          </div>

          <div class="flex items-center w-full max-w-md px-6 mx-auto lg:w-2/6">
            <div class="flex-1">
              <div class="text-center">
                <h2 class="text-4xl font-bold text-center text-sky-400 dark:text-white">Seafreshing</h2>

                <p class="mt-3 text-gray-500 dark:text-gray-300">Sign up to access your account</p>
              </div>

              <div class="mt-8">
                <form onSubmit={handleRegister}>
                  <div>
                    <label for="fullname" class="block mb-2 text-sm text-gray-600 dark:text-gray-200">Full Name</label>
                    <input type="text" name="fullname" id="fullname" placeholder="Your Name" value={fullname} onChange={(e) => setFullName(e.target.value)} required class="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-400 bg-white border border-gray-200 rounded-md dark:placeholder-gray-600 dark:bg-gray-900 dark:text-gray-300 dark:border-gray-700 focus:border-blue-400 dark:focus:border-blue-400 focus:ring-blue-400 focus:outline-none focus:ring focus:ring-opacity-40" />
                  </div>

                  <div class="mt-6">
                    <label for="email" class="block mb-2 text-sm text-gray-600 dark:text-gray-200">Email Address</label>
                    <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required name="email" id="email" placeholder="example@example.com" class="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-400 bg-white border border-gray-200 rounded-md dark:placeholder-gray-600 dark:bg-gray-900 dark:text-gray-300 dark:border-gray-700 focus:border-blue-400 dark:focus:border-blue-400 focus:ring-blue-400 focus:outline-none focus:ring focus:ring-opacity-40" />
                  </div>

                  <div class="mt-6">
                    <div class="flex justify-between mb-2">
                      <label for="password" class="text-sm text-gray-600 dark:text-gray-200">Password</label>
                    </div>

                    <input type="password" value={passowrd} onChange={(e) => setPassword(e.target.value)} required name="password" id="password" placeholder="Your Password" class="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-400 bg-white border border-gray-200 rounded-md dark:placeholder-gray-600 dark:bg-gray-900 dark:text-gray-300 dark:border-gray-700 focus:border-blue-400 dark:focus:border-blue-400 focus:ring-blue-400 focus:outline-none focus:ring focus:ring-opacity-40" />
                  </div>

                  <div class="mt-6">
                    <div class="flex justify-between mb-2">
                      <label for="password" class="text-sm text-gray-600 dark:text-gray-200">Confirm Password</label>
                    </div>

                    <input type="password" name="password" id="password" placeholder="Confirm Password" class="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-400 bg-white border border-gray-200 rounded-md dark:placeholder-gray-600 dark:bg-gray-900 dark:text-gray-300 dark:border-gray-700 focus:border-blue-400 dark:focus:border-blue-400 focus:ring-blue-400 focus:outline-none focus:ring focus:ring-opacity-40" />
                  </div>


                  <div class="mt-6">
                    <button
                      class="w-full px-4 py-2 tracking-wide text-white transition-colors duration-200 transform bg-blue-500 rounded-md hover:bg-blue-400 focus:outline-none focus:bg-blue-400 focus:ring focus:ring-blue-300 focus:ring-opacity-50">
                      Sign up
                    </button>
                  </div>

                </form>

              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Register;
